import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return;
  <div>
    <div>hi</div>
    props.items.map((ExpItem) => {
      <ExpenseItem
        title={ExpItem.title}
        amount={ExpItem.amount}
        date={ExpItem.date}
      />
    }
    );
  </div>;
}

export default Expenses;
